caption.text:
Ini memang hanya piala, namun pengorbanan waktu, tenaga dan emosi yang tdk bernilai menggambarkan perjuangan terakhir kelas di "proker" penutup di tahun ini.

Kemenangan ini tdk berarti tanpa semangat kebersamaan dan tentunya rejeki. Kita emang msh jauh dari kesempurnaan di segala sisi, namun pelan namun pasti in shaa Allah kita akan mencapai itu dan mengingat semua perjuangan ini di 10-20 tahun mendatang. Semoga kita sukses dan selalu dilancarkan dlm perjalanan menjadi dokter!

